CREATE TABLE IF NOT EXISTS `categorysubjectwise` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `category` varchar(45) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `examcategory` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `category` varchar(45) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=17 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `examsubcategory` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cat_id` int(11) NOT NULL,
  `subcategory` varchar(45) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_cat_idx` (`cat_id`),
  CONSTRAINT `fk_cat` FOREIGN KEY (`cat_id`) REFERENCES `examcategory` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=20 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `questionbank` (
  `id` varchar(100) NOT NULL,
  `test_id` varchar(250) DEFAULT NULL,
  `question_type` varchar(45) NOT NULL,
  `paragraph_text` varchar(2000) DEFAULT NULL,
  `question_text` varchar(2000) NOT NULL,
  `optionA` varchar(2000) NOT NULL,
  `optionB` varchar(2000) NOT NULL,
  `optionC` varchar(2000) NOT NULL,
  `optionD` varchar(2000) NOT NULL,
  `correct_option` varchar(45) NOT NULL,
  `explanation` varchar(2000) DEFAULT NULL,
  `active` varchar(45) NOT NULL DEFAULT 'true',
  `category_bank` int(11) NOT NULL,
  `subcategory_bank` int(11) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `questionbank_categorysubjectwise_idx` (`category_bank`),
  KEY `questionbank_subcategorysubjectwise_idx` (`subcategory_bank`),
  CONSTRAINT `questionbank_categorysubjectwise` FOREIGN KEY (`category_bank`) REFERENCES `categorysubjectwise` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `questionbank_subcategorysubjectwise` FOREIGN KEY (`subcategory_bank`) REFERENCES `subcategorysubjectwise` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `questions` (
  `id` varchar(100) NOT NULL,
  `test_id` int(11) NOT NULL,
  `question_type` varchar(45) NOT NULL,
  `paragraph_text` varchar(2000) DEFAULT NULL,
  `question_text` varchar(2000) NOT NULL,
  `optionA` varchar(2000) DEFAULT NULL,
  `optionB` varchar(2000) DEFAULT NULL,
  `optionC` varchar(2000) DEFAULT NULL,
  `optionD` varchar(2000) DEFAULT NULL,
  `correct_option` varchar(2000) DEFAULT NULL,
  `explanation` varchar(2000) DEFAULT NULL,
  `active` varchar(45) NOT NULL DEFAULT 'true',
  PRIMARY KEY (`id`,`test_id`),
  KEY `question_fk_idx` (`test_id`),
  CONSTRAINT `question_fk` FOREIGN KEY (`test_id`) REFERENCES `testdetails` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `subcategorysubjectwise` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cat_id` int(11) NOT NULL,
  `subcategory` varchar(45) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `category_subjectwise_idx` (`cat_id`),
  CONSTRAINT `category_subjectwise` FOREIGN KEY (`cat_id`) REFERENCES `categorysubjectwise` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `testdetails` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `cat_id` int(11) NOT NULL,
  `subcat_id` int(11) NOT NULL,
  `title` varchar(45) NOT NULL,
  `no_of_ques` int(11) NOT NULL,
  `time_limit` int(11) NOT NULL,
  `correct_ans_marks` int(11) NOT NULL,
  `wrong_ans_marks` int(11) NOT NULL,
  `passing_percentage` int(11) DEFAULT NULL,
  `shuffle_ques` tinyint(5) DEFAULT NULL,
  `shuffle_options` tinyint(5) DEFAULT NULL,
  `attempt_multiple_times` tinyint(5) DEFAULT NULL,
  `active` varchar(10) DEFAULT 'false',
  `candidate_count` int(11) NOT NULL DEFAULT '0',
  PRIMARY KEY (`id`),
  KEY `fk_category_idx` (`cat_id`),
  KEY `fk_subcategory_idx` (`subcat_id`),
  CONSTRAINT `fk_category` FOREIGN KEY (`cat_id`) REFERENCES `examcategory` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_subcategory` FOREIGN KEY (`subcat_id`) REFERENCES `examsubcategory` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=1458429742 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `testreports` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `test_id` int(11) NOT NULL,
  `username` varchar(45) NOT NULL,
  `emailid` varchar(100) NOT NULL,
  `mobile_number` varchar(45) DEFAULT NULL,
  `marks_scored` int(11) NOT NULL,
  `time_taken` int(11) DEFAULT NULL,
  `rank` int(11) NOT NULL,
  `questions_attempted` int(11) NOT NULL,
  `correct_ques` int(11) NOT NULL,
  `incorrect_ques` int(11) NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=106 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `usercreds` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `user_id` varchar(50) NOT NULL,
  `password` varchar(50) NOT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_user_id_idx` (`user_id`),
  CONSTRAINT `fk_user_id` FOREIGN KEY (`user_id`) REFERENCES `userdetails` (`id`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=5 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `userdetails` (
  `id` varchar(50) NOT NULL,
  `name` varchar(45) NOT NULL,
  `email` varchar(45) NOT NULL,
  `mobileno` bigint(15) DEFAULT NULL,
  PRIMARY KEY (`id`),
  UNIQUE KEY `email_UNIQUE` (`email`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8;










